import styles from './PeopleList.module.css';

const PeopleList = (props) => {
    const {people} = props.people;
    return (
        <ul>
            {people.map(({id, name, img})=> 
                <li key={id}>
                    <img src={img} alt="avatar"/>
                    <p>{name}</p>
                </li>
            )};
        </ul>
    )
}

export default PeopleList;
